import React from "react";

const about = props => ({
  images: [
    "./images/about/1.jpg",
    "./images/about/2.jpg",
    "./images/about/3.jpg",
    "./images/about/4.jpg"
  ],
  content: (
    <div>
      <p>
        My Name is Ali Hedayatnia. I am a B.Sc. student in University of Tehran.
        I start my B.Sc. studies in Computer Architecture.
      </p>
    </div>
  )
});

export default about;
